USE disney

CREATE TABLE IF NOT EXISTS Disney_marvel_movies (
     budget  INT,
     genres  VARCHAR(199),
     homepage  VARCHAR(92),
     id  INT,
     keywords  VARCHAR(1329),
     original_language  VARCHAR(2),
     original_title  VARCHAR(62),
     popularity  NUMERIC(9, 6),
     production_companies  VARCHAR(502),
     production_countries  VARCHAR(188),
     release_date  DATETIME,
     revenue  INT,
     runtime  INT,
     spoken_languages  VARCHAR(241),
     status  VARCHAR(8),
     tagline  VARCHAR(108),
     title  VARCHAR(62),
     vote_average  NUMERIC(2, 1),
     vote_count  INT
);

DROP TABLE IF EXISTS disney.Disney_marvel_movies ;

    
    
    SELECT * FROM Disney_marvel_movies